import React from 'react';
import './About.css';
function About()
{
    return (
        <section className="about-section">
            <div className="container">
                <div className="row">
                    <div className="section-title">
                        {/* <h2> */}
                            About Me
                        {/* </h2> */}
                    </div>
                </div>
           </div>
        </section>
    );

}
export default About;
